import React from 'react';
import AppLayout from "../components/AppLayout"

import Head from "next/head"

function Profile(){

    return (
        <>
            <Head>
                <title>profile</title>
            </Head>
            <AppLayout>
                my profile
            </AppLayout>
        </>
    )
}

export default Profile;
